import React from 'react';
import "./Navbar.css";
import { Navbar, Container, Nav, FormControl, ControlLabel, InputGroup } from "react-bootstrap";


function HeadNavbar(props) {
    return (
        // <div className='navbar'>

        //     <div className='navbar-subheading'>

        //         <div className='navbar-heading'>
        //             IntelliED
        //         </div>

        //         <div className='navbar-feature'> Features </div>

        //         

        //         <div className='demo-button'>
        //             <button className='navbar-demo'><span className='demo-text'> Free Demo</span></button>
        //         </div>
        //     </div>

        // </div>
        <>
        <Navbar  expand="lg">
            <Container>
                <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="me-auto">
                    <Nav.Link href="#home">Home</Nav.Link>
                    <Nav.Link href="#link">Link</Nav.Link>

                </Nav>
                </Navbar.Collapse>
            </Container>
            </Navbar>
            <Navbar  variant="dark" className="navbar">
                <Container>
                <Navbar.Brand href="#home">
                IntelliED
                {/* <div className='navbar-heading'>

                </div> */}
                </Navbar.Brand>
                <Nav className="me-auto">
                <Nav.Link href="#home">
                    Features
                    {/* <div className='navbar-feature'> Features </div> */}
                </Nav.Link>
                <Nav.Link href="#features">
                    How it work
                    {/* <div className='navbar-work'>How it works</div> */}
                </Nav.Link>
                <Nav.Link href="#pricing">
                    {/* <div className='demo-button'>
                        <button className='navbar-demo'><span className='demo-text'> Free Demo</span></button>
                    </div> */}
                </Nav.Link>
                </Nav>
                </Container>
            </Navbar>

        </>
    );
}

export default HeadNavbar;
